  componentDidMount(){
      axios.get('https://api.github.com/users')
      .then(res=>console.log(res.data)); 
  }
  render()
{
   return (
   <div className='App'>
       <Navigation title="Github Finder"/>
       <UserItem />
   </div>);
}
}
export default App;
